import React from "react";
import './FeatureSection.css'; // 스타일을 위한 CSS 파일 임포트

function FeatureSection() {
  return (
    <div className="feature-section">
      <div className="feature-item">추천1</div>
      <div className="feature-item">추천2</div>
      <div className="feature-item">추천3</div>
      <div className="feature-item">추천4</div>
    </div>
  );
}

export default FeatureSection;
